1. Mengembangkan dan mengeksekusi strategi marketing; 
2. Melakukan market research dan memberikan insight kepada tim product dan manajemen; 
3. Membantu partner dan tim operasional; 
4. Ikut berpartisipasi dan meningkatkan interaksi pada kelas online; 
5. Mengatur kalender akademik bersama partner; 
6. Membuat rencana promosi 
7. Menawarkan rancangan iklan atau publisitas kepada klien; 
8. Menjalin komunikasi kepada perusahaan atau klien dalam menjalin kerja sama.

1. Mendefinisikan dan mengidentifikasi permasalahan kualitas data tabular dan data geospasial serta menentukan objektif analisis kualitas data;
2. Mengidentifikasi dan menyusun kebutuhan data tabular dan data geospasial;
3. Melakukan pengukuran dan analisis kualitas data berdasarkan standarisasi kualitas data yang berlaku;
4. Memberikan rekomendasi data tabular dan data geospasial yang harus diproduksi dan diperbaiki berdasarkan hasil analisis kualitas data;
5. Menyusun dan mengembangkan struktur tabel dan tipe data variabel pada lembar kerja sesuai dengan standardisasi yang sudah ditentukan dan melakukan pengolahan, penyeragaman, dan pembersihan data;
6. Mengkompilasi dan mengunggah dataset ke dalam aplikasi portal data;
7. Melakukan pengembangan wawasan dan berbagi pengetahuan perkembangan teknik dasar pengolahan data serta menyusun dan mengelola paparan dan dokumen teknis terkait hasil riset dan hasil pengolahan data yang sudah dikerjakan untuk mendukung manajemen pengetahuan;

1. Mendefinisikan dan mengidentifikasi permasalahan dan kebutuhan business dan data serta menentukan objektif Data Science dan Machine Learning;
2. Menyusun rekomendasi pengumpulan data baru dan melakukan strukturisasi ulang format data sesuai kebutuhan analisisi data tingkat lanjut;
3. Melakukan analisis data tingkat lanjut dengan mengembangkan algoritma dan model data serta melakukan interpretasi hasil analisis data tingkat lanjut secara kolaborasi dengan pihak internal atau eksternal organisasi berdasarkan identifikasi permasalahan dan objektif bisnis yang sudah ditetapkan; 
4. Melakukan pengembangan wawasan dan berbagi pengetahuan perkembangan teknik analisis data tingkat lanjut dengan pendekatan Data Science dan Machine Learning serta menyusun dan mengelola paparan dan dokumen teknis terkait hasil riset dan hasil proyek analisis data tingkat lanjut yang sudah dikerjakan untuk mendukung manajemen pengetahuan.

Pekerjaan administrasi terkait dengan bantuan pembangunan rumah susun, meliputi:
- verifikasi kelayakan administrasi dan kelayakan teknis usulan bantuan pembangunan rumah susun;
- review DED/gambar kerja rumah susun;
- Monitoring dan evaluasi progres pembangunan rumah susun;
- Membuat laporan kegiatan (rapat/monev) dan melaporkan pada atasan.

a.	menyusun laporan hasil evaluasi dokumen perencanaan SPAM (Detail Engineering Design/DED) untuk proyek KPBU SPAM;
b.	membantu melakukan evaluasi teknis dan memberikan rekomendasi pada proyek KPBU SPAM;
c.	menyusun laporan hasil konsolidasi dan evaluasi rencana penyerapan hilir, termasuk melakukan pengecekan perencanaan, konstruksi, pembiayaan, dan lainnya yang sesuai bidang keahlian;
d.	membantu tim swakelola melaksanakan kegiatan inventarisasi isu-isu penting, dan monitoring permasalahan proyek secara teknis pada proyek KPBU SPAM; 
e.	menyusun laporan pemantauan progres pelaksanaan pekerjaan secara berkala;
f.	menyusun Laporan Pendahuluan, Laporan Antara dan Laporan Akhir.

Menjadi Officer K3 dan Enviro (EHS Specialist) di perusahaan perkebunan kelapa sawit. 

-Melaksanakan sistem manajemen K3 dan Lingkungan;
-Mengidentifikasi bahaya dan risiko pada pekerjaan operasional;
-Membuat laporan rutin K3 dan Lingkungan, investigasi kecelakaan kerja
-Mengordinir pelaksanaan penilaian PROPER KLHK.

1.	Membantu fasilitasi seluruh kegiatan NUDP di lingkup Ditjen Bina Pembangunan Daerah dalam dukungan penyediaan dan penyajian data;
2.	Membantu fasilitasi, inventarisasi dan analisa data di lingkup Ditjen Bina Pembangunan Daerah; 
3.	Membantu fasilitasi Penyusunan Kegiatan Tahunan (AWP) PIU Ditjen Bina Bangda;
4.	Membantu fasilitasi Pelaksanaan Kegiatan Tahunan (OWP) PIU Ditjen Bina Bangda;

1. Penyiapan perumusan kebijakan dan strategi operasional, rencana dan program di bidang pembinaan perencanaan tata ruang daerah dan kawasan tematik di Wilayah Pulau Nusa Tenggara, Pulau Kalimantan, Pulau Sulawesi, Pulau Maluku, dan Pulau Papua;
2. Pelaksanaan monitoring dan evaluasi pelaksanaan kebijakan teknis dan program di bidang pembinaan perencanaan tata ruang daerah dan kawasan tematik di Wilayah Pulau Nusa Tenggara, Pulau Kalimantan, Pulau Sulawesi, Pulau Maluku, dan Pulau Papua;
3. Pelaksanaan bimbingan teknis dan bantuan teknis perencanaan tata ruang kepada pemerintah provinsi, pemerintah kabupaten, dan pemerintah kota, termasuk pemenuhan standar pelayanan minimum bidang penataan ruang;
4. Fasilitasi pemberian persetujuan substansi perencanaan tata ruang daerah dan kawasan tematik
5. Pelaksanaan urusan tata usaha dan rumah tangga Direktorat.

1) Melakukan pendampingan kepada masyarakat dan kelompok masyarakat terkait dengan Penataan Kelembagaan Penanganan Akses Reforma Agraria;
2) Membantu petugas Kantor Pertanahan dalam penyusunan perencanaan kegiatan pemberdayaan tanah masyarakat;
3) Membantu petugas Kantor Pertanahan dalam setiap kegiatan yang berkaitan dengan kegiatan Penanganan Akses Reforma Agraria;
4) Melakukan input data terkait seluruh rangkaian kegiatan Penanganan Akses Reforma Agraria ke dalam Aplikasi dan/atau instrumen lain;
5) Memotivasi masyarakat untuk berpartisipasi dalam seluruh kegiatan yang berkaitan dengan program pemberdayaan tanah masyarakat;
6) Menyusun laporan bulanan kepada Kepala Seksi Penataan dan Pemberdayaan di Kantor Pertanahan;
7) Menyusun dan menyampaikan laporan akhir pelaksanaan kegiatan Penataan Kelembagaan Penanganan Akses Reforma Agraria yang diketahui oleh minimal Koordinator Substansi pada seksi Penataan dan Pemberdayaan kepada Pejabat Pembuat Komitmen.

Merencanakan dan menetapkan kebijakan teknis dan Standar Operasional Prosedur (SOP) di bidang perencanaan pembangunan daerah; 
Menyelenggarakan urusan pemerintahan dan pelayanan umum di bidang perencanaan pembangunan daerah;
Menyelenggarakan pengadaan prasarana dan sarana penunjang terkait bidang tugas Badan;
Menyelenggarakan, mengkoordinasikan dan mengevaluasi kinerja program/kegiatan pengelolaan kesekretariatan Badan;
Menyelenggarakan, mengkoordinasikan dan mengevaluasi kinerja di bidang perencanaan, pengendalian dan evaluasi pembangunan;
Menyelenggarakan, mengkoordinasikan dan mengevaluasi kinerja di bidang perencanaan sosial budaya dan pemerintahan; 
Menyelenggarakan, mengkoordinasikan dan mengevaluasi kinerja di bidang perencanaan infrastruktur dan ekonomi;
Menyelenggarakan, mengkoordinasikan dan mengevaluasi kinerja di bidang penelitian, pengembangan dan data;
Menyelenggarakan koordinasi dengan Sekretariat Daerah terkait pelayanan di bidang perencanaan pembangunan daerah;
Menyelenggarakan koordinasi dengan Pemerintah, Pemerintah Provinsi, DPRD dan Instansi terkait dan mitra kerja lainnya dalam pelaksanaan kebijakan bidang tugas;
Menyelenggarakan pengendalian internal, akuntabilitas kinerja dan laporan kinerja serta laporan penyelenggaraan pemerintah daerah lingkup Badan; dan
Menyelenggarakan tugas kedinasan lain sesuai dengan bidang tugas dan fungsinya.

Berkoordinasi dengan cross-functional teams untuk melakukan perencanaan serta pengembangan produk yang efisien dan tepat guna;
Memimpin proses untuk mengumpulkan feedback dari pengguna dan pemangku kepentingan untuk pengembangan produk selanjutnya serta membantu mengelola pengembangan produk secara menyeluruh (end-to-end);
Melakukan problem solving, identifikasi permasalahan dan memberikan solusi, melakukan skala prioritas dalam pekerjaan termasuk dalam eskalasi di tingkat tim dan pimpinan;
